import React, { useState, useEffect } from 'react';
import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonButton,
  IonImg,
  IonCard,
  IonCardTitle,
  IonCardSubtitle,
  IonText
} from '@ionic/react';

function App() {
  const [imageUrl, setImageUrl] = useState('');

  const fetchRandomImage = () => {
    // Defina a URL da imagem diretamente
    const imageUrl = 'https://pic.re/image';

    setImageUrl(imageUrl);
  }

  useEffect(() => {
    fetchRandomImage();
  }, []);

  return (
    <IonPage style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
      <IonHeader>

      </IonHeader>

      <IonCard style={{ backgroundColor: '#DCDCDC', width:1000 }}>
        <IonCardTitle style={{ fontSize: 24, fontWeight: 'bold' }}>Bem-vindo ao Meu Site</IonCardTitle>
        <br></br><IonText>Este é um parágrafo de exemplo </IonText>
        <br></br><IonButton>Clique aqui</IonButton>


      </IonCard>

      <IonCard style={{ backgroundColor: '#DCDCDC' }}>
      <IonCardTitle>Seção Importante</IonCardTitle>
      </IonCard>  

    </IonPage>
  );
} 
export default App;
